import React, {useState} from "react";
import Modal from "react-modal";
import s2 from '../images/s2.jpeg';

const S2 = () => {
  const [modal_IsOpen, set_IsOpen] = useState(false);

  const openModal = () => {
    set_IsOpen(true);
  }

  const closeModal = () => {
    set_IsOpen(false);
  }

  return (
    <>
      <img onClick={openModal} className="square" src={s2} />
      <Modal 
        isOpen={modal_IsOpen}
        onRequestClose={closeModal}
        className="modal"
        ariaHideApp={false}
        closeTimeoutMS={200}
        onAfterOpen
        >
        <div className="container-img">
          <img className="img" src={s2} />
          <button onClick={closeModal} className="btn">Back</button>
        </div>
        </Modal>
    </>
  )
}

export {S2 as default};
